import React from "react";

import Link from "next/link";

const NavLink = ({ href }) => {
  return (
    <Link href={href}>
      <a>Sobre</a>
    </Link>
  );
};

const NavBar = () => {
  return (
    <div className="bg-gray-500 py-4">
      <NavLink href="/sobre" />
    </div>
  );
};

export default NavBar;
